/* eslint-disable react/style-prop-object */
import React from 'react';
import '../../App.css';

export default function Products() {
  return (
    <div className="products">
      <h5>Hi, I am Florence!</h5>
      <p style="font-size:12">Greetings, I'm Florence, your dedicated healthcare companion, here to provide steadfast support in your journey to wellness. 
        Whether you've faced the rigors of combat or simply seek guidance on your health path, I'm at your service. 
        For those who've served, I understand the unique challenges you may encounter post-duty, and I'm equipped with specialized resources to assist you in navigating the complexities of healthcare. 
        From addressing physical ailments to tending to the unseen wounds that linger, I'm here to offer solace and aid every step of the way. 
        And for the wider community, I'm committed to sharing insights and knowledge, ensuring that everyone has access to the tools they need for a healthier tomorrow. 
        Together, let's stride forward on the path to vitality and well-being.</p>
    </div>
  );
}
